import React from "react";
import { Link } from "react-router-dom";

function TripsCardsItems() {
  return (
    <>
      <li className="trips__cards__item">
        <Link className="trips__cards__item__link">
          <figure className="trips__cards__item__pic-wrap">
            <img className="trips_cards__item__img" alt=""></img>
          </figure>
          <div className="trips__cards__item__info">
            <h5 className="trips__cards__item__text">2</h5>
          </div>
        </Link>
      </li>
    </>
  );
}

export default TripsCardsItems;
